package com.tcb.env.model;

public class AreaStatisticModel extends BaseModel {

	private String areaId;
	private String areaName;
	private String disRatio;
	private String avgValue;
	private String totalValue;
	private String mainWd;
	private String mainWs;
	
	/**
	 * @return the areaId
	 */
	public String getAreaId() {
		return areaId;
	}
	/**
	 * @param areaId the areaId to set
	 */
	public void setAreaId(String areaId) {
		this.areaId = areaId;
	}
	/**
	 * @return the areaName
	 */
	public String getAreaName() {
		return areaName;
	}
	/**
	 * @param areaName the areaName to set
	 */
	public void setAreaName(String areaName) {
		this.areaName = areaName;
	}
	/**
	 * @return the disRatio
	 */
	public String getDisRatio() {
		return disRatio;
	}
	/**
	 * @param disRatio the disRatio to set
	 */
	public void setDisRatio(String disRatio) {
		this.disRatio = disRatio;
	}
	/**
	 * @return the avgValue
	 */
	public String getAvgValue() {
		return avgValue;
	}
	/**
	 * @param avgValue the avgValue to set
	 */
	public void setAvgValue(String avgValue) {
		this.avgValue = avgValue;
	}
	/**
	 * @return the totalValue
	 */
	public String getTotalValue() {
		return totalValue;
	}
	/**
	 * @param totalValue the totalValue to set
	 */
	public void setTotalValue(String totalValue) {
		this.totalValue = totalValue;
	}
	/**
	 * @return the mainWd
	 */
	public String getMainWd() {
		return mainWd;
	}
	/**
	 * @param mainWd the mainWd to set
	 */
	public void setMainWd(String mainWd) {
		this.mainWd = mainWd;
	}
	/**
	 * @return the mainWs
	 */
	public String getMainWs() {
		return mainWs;
	}
	/**
	 * @param mainWs the mainWs to set
	 */
	public void setMainWs(String mainWs) {
		this.mainWs = mainWs;
	}
	
}
